export const LINKS_LOADING = "LOADING";
export const LINKS_SUCCESS = "SUCCESS";
import axios from "axios";

export const getLinks = () => dispatch => {
    dispatch({ type: LINKS_LOADING })
    axios.get('https://cors-for-all.herokuapp.com/https://scripts-app-backend.herokuapp.com/links')
      .then(res => dispatch({ type: LINKS_SUCCESS, payload: res.data}))
}
